      title: "Appointments",
      htmlBefore: '<i class="material-icons">schedule</i>',
      to:  `/${route}/appointments`
    },
    {
      title: "Documents",
      htmlBefore: "<i class='material-icons'>folder</i>",
      to:  `/${route}/documents`
    },

